Vanilla Deville - Handling A BIG LOAD Of Stress
Added: May 27, 2010

&quot;Vanilla is the boss of her company and is constantly stressed out and working late. One evening, she is so exhausted that she decides to take a nap on her sofa. Just as she is settled down and relaxed the night janitor comes in with his head phones on vacuuming and singing. Not noticing that Vanilla is there he continues making noise until she stops him and makes him get rid of her stress problem.&quot;
